import React , {Component} from 'react'
import './Footer.css'
export default class Footer extends Component{
    render(){
        return(
            <div className="Footer">
                     <div>
                        <h3>CONTACT</h3>
                        <a href="#">Facebook</a><br/>
                        <a href="#">Email</a><br/>
                        <a href="#">Instagram</a><br/>
                        <a href="#">Twitter</a><br/>
                    </div>
            </div>
        )
    }
}
